import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Card, CardContent } from '@/components/ui/card';
import { Button } from '@/components/ui/button';
import { Input } from '@/components/ui/input';
import { Textarea } from '@/components/ui/textarea';
import { Table, TableHeader, TableBody, TableRow, TableHead, TableCell } from '@/components/ui/table';

function AdminPage({ token }) {
  const [questions, setQuestions] = useState([]);
  const [scores, setScores] = useState([]);
  const [formData, setFormData] = useState({
    type: '',
    question: '',
    option_a: '',
    option_b: '',
    option_c: '',
    option_d: '',
    correct_answer: '',
    timer: ''
  });
  const [questionIdToDelete, setQuestionIdToDelete] = useState('');
  const [commonUserPassword, setCommonUserPassword] = useState('');
  const [message, setMessage] = useState('');

  const backendUrl = 'http://localhost:3000';

  const fetchQuestions = async () => {
    try {
      const res = await axios.get(`${backendUrl}/quiz`);
      setQuestions(res.data);
    } catch (err) {
      console.error('Error fetching questions:', err);
    }
  };

  const fetchScores = async () => {
    try {
      const res = await axios.get(`${backendUrl}/scores`);
      setScores(res.data);
    } catch (err) {
      console.error('Error fetching scores:', err);
    }
  };

  useEffect(() => {
    fetchQuestions();
    fetchScores();
  }, []);

  const handleAddQuestion = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post(`${backendUrl}/add-question`, formData);
      setMessage(res.data);
      setFormData({
        type: '', question: '', option_a: '', option_b: '',
        option_c: '', option_d: '', correct_answer: '', timer: ''
      });
      fetchQuestions();
    } catch (err) {
      console.error('Error adding question:', err);
      setMessage('Failed to add question');
    }
  };

  const handleDeleteQuestion = async () => {
    if (!questionIdToDelete) return;
    try {
      const res = await axios.delete(`${backendUrl}/delete-quiz/${questionIdToDelete}`);
      setMessage(res.data);
      setQuestionIdToDelete('');
      fetchQuestions();
    } catch (err) {
      console.error('Error deleting question:', err);
      setMessage('Failed to delete question');
    }
  };

  const handleSetUserPassword = async () => {
    try {
      const res = await axios.post(`${backendUrl}/set-user-password`, { password: commonUserPassword });
      setMessage(res.data);
    } catch (err) {
      console.error('Error setting user password:', err);
      setMessage('Failed to set password');
    }
  };

  return (
    <div className="p-6 space-y-6">
      <h2 className="text-2xl font-semibold">Admin Panel</h2>
      {message && <p className="text-green-600 font-medium">{message}</p>}

      <Card>
        <CardContent className="space-y-4 p-4">
          <h3 className="text-xl font-semibold">Add Quiz Question</h3>
          <form onSubmit={handleAddQuestion} className="grid grid-cols-2 gap-4">
            <Input placeholder="Type (e.g., MCQ)" value={formData.type} onChange={(e) => setFormData({ ...formData, type: e.target.value })} required />
            <Input type="number" placeholder="Timer (seconds)" value={formData.timer} onChange={(e) => setFormData({ ...formData, timer: e.target.value })} required />
            <Textarea className="col-span-2" placeholder="Question" value={formData.question} onChange={(e) => setFormData({ ...formData, question: e.target.value })} required />
            <Input placeholder="Option A" value={formData.option_a} onChange={(e) => setFormData({ ...formData, option_a: e.target.value })} required />
            <Input placeholder="Option B" value={formData.option_b} onChange={(e) => setFormData({ ...formData, option_b: e.target.value })} required />
            <Input placeholder="Option C" value={formData.option_c} onChange={(e) => setFormData({ ...formData, option_c: e.target.value })} required />
            <Input placeholder="Option D" value={formData.option_d} onChange={(e) => setFormData({ ...formData, option_d: e.target.value })} required />
            <Input placeholder="Correct Answer (A/B/C/D)" value={formData.correct_answer} onChange={(e) => setFormData({ ...formData, correct_answer: e.target.value })} required />
            <Button type="submit" className="col-span-2">Add Question</Button>
          </form>
        </CardContent>
      </Card>

      <Card>
        <CardContent className="space-y-4 p-4">
          <h3 className="text-xl font-semibold">Delete Question</h3>
          <div className="flex items-center gap-4">
            <Input type="number" placeholder="Question ID to delete" value={questionIdToDelete} onChange={(e) => setQuestionIdToDelete(e.target.value)} />
            <Button onClick={handleDeleteQuestion}>Delete</Button>
          </div>
        </CardContent>
      </Card>

      <Card>
        <CardContent className="space-y-4 p-4">
          <h3 className="text-xl font-semibold">User Scores</h3>
          <Table>
            <TableHeader>
              <TableRow>
                <TableHead>User</TableHead>
                <TableHead>Score</TableHead>
                <TableHead>Date</TableHead>
              </TableRow>
            </TableHeader>
            <TableBody>
              {scores.map(score => (
                <TableRow key={score.id}>
                  <TableCell>{score.username}</TableCell>
                  <TableCell>{score.score}</TableCell>
                  <TableCell>{new Date(score.date_taken).toLocaleString()}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </CardContent>
      </Card>

      <Card>
        <CardContent className="space-y-4 p-4">
          <h3 className="text-xl font-semibold">Set Common User Password</h3>
          <div className="flex items-center gap-4">
            <Input type="password" placeholder="New user password" value={commonUserPassword} onChange={(e) => setCommonUserPassword(e.target.value)} />
            <Button onClick={handleSetUserPassword}>Set Password</Button>
          </div>
        </CardContent>
      </Card>

      <Card>
        <CardContent className="space-y-4 p-4">
          <h3 className="text-xl font-semibold">All Quiz Questions</h3>
          <ul className="space-y-2 list-disc ml-6">
            {questions.map(q => (
              <li key={q.id}>
                <strong>Q{q.id}:</strong> {q.question} (Timer: {q.timer}s)
                <ul className="ml-4 list-disc">
                  <li>A: {q.option_a}</li>
                  <li>B: {q.option_b}</li>
                  <li>C: {q.option_c}</li>
                  <li>D: {q.option_d}</li>
                  <li><strong>Answer:</strong> {q.correct_answer}</li>
                </ul>
              </li>
            ))}
          </ul>
        </CardContent>
      </Card>
    </div>
  );
}

export default AdminPage;
